<body>
<ux:panels class="dwpe-header">
  <div class="dwpe-pageheader-label">Plan Workbench</div>
</ux:panels>
<ux:toolbars class='dwpe-toolbar'>
  <ul>
    <li class='dwpe-button InlineSelector' ><span class='label'>Plan</span><span class='arw'>&nbsp;</span>
      <ul class='inline-selector-menu'>
        <li class=' TextButton  1 '>Create New Plan</li>
        <li class=' TextButton  1 '>Edit Plan</li>
        <li class=' TextButton  1 '>Delete Plan</li>
        <li class=' TextButton  1 '>Copy Plan</li>
        <li class=' TextButton  1 '>Launch</li>
        <li class=' TextButton  1 '>Load</li>
        <li class=' TextButton  1 '>Compare</li>
      </ul>
    </li>
    <li class='dwpe-button InlineSelector' ><span class='label'>View</span><span class='arw'>&nbsp;</span>
      <ul class='inline-selector-menu'>
        <li class=' TextButton  1 '>Item</li>
        <li class=' TextButton  1 '>Item</li>
      </ul>
    </li>
    <li class='dwpe-button Separator'><span></span></li>
    <li class='dwpe-button IconicButton' >
      <div class='icons  ico-create ' ></div>
    </li>
    <li class='dwpe-button IconicButton' >
      <div class='icons  ico-duplicate '  title='Duplicate' ></div>
    </li>
    <li class='dwpe-button IconicButton' >
      <div class='icons  ico-edit '  title='Edit' ></div>
    </li>
    <li class='dwpe-button IconicButton' >
      <div class='icons  ico-remove '  title='Remove' ></div>
    </li>
    <li class='dwpe-overflow-btn aft'></li>
  </ul>
  <div class='dwpe-toolbar-resize'  style='display:none'  ></div>
